export default function Contact(props){
    let contact=props.content;
    return (
        <>
            <div className="flex p-3 rounded-md " id="contact">
                <div className="h-full relative w-1/2">
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaUanxBSPWKztUx51vuqzmY9K0jqg3k5jERW9TJm3yu2sj54zF3kL-z8LIS_21sw4vWQ0&usqp=CAU" className="bgImageClass"></img>
                    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaUanxBSPWKztUx51vuqzmY9K0jqg3k5jERW9TJm3yu2sj54zF3kL-z8LIS_21sw4vWQ0&usqp=CAU" className="contactImg"></img>
                </div>
                <div className="w-1/2 p-8 bg-white rounded-md">
                {
                    contact.map((el)=>(
                        <div class="mb-4">
                            <label for="name" class="block text-md font-bold text-indigo-900 mb-1">{el.label}</label>
                            <input
                                type={el.inputType}
                                id={el.label}
                                name={el.label}
                                placeholder={el.placeholder}
                                class="w-full px-4 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                            />
                        </div>
                    ))
                }
                <button class="px-6 py-2 bg-indigo-900 text-center text-white rounded-xl shadow hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-400 focus:ring-offset-1 transition">Submit</button>
                </div>
            </div>
        </>
    )
}
